<script>

import ProductsPage from "@/component/pages/ProductsPage";
export default {
    name: "HowPage",

    components: {
        ProductsPage
    },

    data: () => ({
        openedPanels: [0],

        isVisible: false,
    }),

    computed: {
        isMobile() {
            return window.innerWidth <= 960;
        },
    },

    methods: {
        openLink(url) {
            if (url) {
                window.open(url, '_blank').focus();
            }
        },

        openPanelImg(i) {
            this.openedPanels =[];
            this.openedPanels.push(i);
        },

        openPanel(i) {
            if (this.openedPanels[0] !== i) {
                this.openedPanels = [].push(i);
            }
        },

        visibilityChanged (isVisible, entry) {
            if (isVisible) {
                this.isVisible = true;
            }
        }
    }
}
